import React from 'react'
import { Link } from 'react-router-dom'
import defaultImg from '../assets/images/room-1.jpeg'

export default function ListingCard(houses) {

   // const houseInfo = house.fields;
    // const { title, capacity,type, images, price, city, state, zip
    // } = houseInfo;

    let price = houses.price;
    let housestatusType = houses.statusType;
    let beds, baths, city, state, zip;

   // console.log(houses);
   // console.log(houses.visited)
    if (!!houses.zpid) {
        // with zpid
        beds = houses.beds;
        baths = houses.baths;
        city = houses.hdpData.homeInfo.city;
        state = houses.hdpData.homeInfo.state;
        zip = houses.hdpData.homeInfo.zipcode;
        let location = city+" • "+ state+" • "+zip;
    } else {
        // with buildingId
        beds = houses.minBeds;
        baths = houses.minBaths;
    }

    return (

        <div className="listing-card-container">
            {/* Listing Card Image */}
            <div className="listing-card-image-container">
                 {/* <img src={images[0].fields.file.url || defaultImg} alt="house listing"></img>  */}
            </div>

             {/* Listing Card Content */}
            <div className="listing-card-content-container">
                {/*  <Link to={`/listing/${house.sys.id}`} className='house-title'> 
                <Link to="/home" className="house-card-title"> {title} </Link> */}
                <Link to={`/housedetails/${houses.zip}`} className="house-card-title">  </Link>
                <div className="house-card-detail">
                    {/* <p>Type: {`${type}`}</p>
                    <p>Capacity: {capacity}</p>
                    <p>{`${city} • ${state} • ${zip}`}</p>
                    <p><span className="price-tag">{`$${price}`}</span> / month </p> */}
                    <p>Price: {price}</p>
                    <p>Type: {housestatusType}</p>
                    <p>beds: {beds}</p>
                    <p>baths: {baths}</p>
                    <p>{`${city} • ${state} • ${zip}`}</p>
                </div>

            </div>

        </div>
    )
}
